import{_ as e,c as t,o,e as r}from"./404.md.b5733099.js";const b=`{"title":"Hacktoberfest","description":"","frontmatter":{"hidden":true,"show_toc":false,"show_contributors":false,"title":"Hacktoberfest"},"headers":[{"level":3,"title":"Hacktoberfest","slug":"hacktoberfest"},{"level":3,"title":"How to get started","slug":"how-to-get-started"},{"level":1,"title":"Organizations","slug":"organizations"},{"level":2,"title":"Bedrock-OSS","slug":"bedrock-oss"},{"level":3,"title":"[Bedrock Wiki](https://github.com/Bedrock-OSS/bedrock-wiki)","slug":"bedrock-wiki"},{"level":3,"title":"[Regolith](https://github.com/Bedrock-OSS/regolith)","slug":"regolith"},{"level":3,"title":"[Regolith Filters](https://github.com/Bedrock-OSS/regolith-filters)","slug":"regolith-filters"},{"level":3,"title":"[Bedrock Loot Gen](https://github.com/Bedrock-OSS/bedrock-loot-gen)","slug":"bedrock-loot-gen"},{"level":3,"title":"[FaqBot](https://github.com/Bedrock-OSS/bedrock-scripting-faq-bot)","slug":"faqbot"},{"level":2,"title":"Blockception","slug":"blockception"},{"level":3,"title":"[Blockception's Minecraft Bedrock Development](https://github.com/Blockception/VSCode-Bedrock-Development-Extension)","slug":"blockception-s-minecraft-bedrock-development"},{"level":3,"title":"[Minecraft Json Schemas](https://github.com/Blockception/Minecraft-bedrock-json-schemas)","slug":"minecraft-json-schemas"}],"relativePath":"hacktoberfest.md"}`,a={},i=r('<h3 id="hacktoberfest" tabindex="-1">Hacktoberfest <a class="header-anchor" href="#hacktoberfest" aria-hidden="true">#</a></h3><p>Each year there is a hacktoberfest event where you can get a free t-shirt by contributing to open source projects. This year the event is from October 1st to October 31st. You can find more information about the event <a href="https://hacktoberfest.com/" target="_blank" rel="noopener noreferrer">here</a>.</p><p>We as a bedrock OSS want to help as well and are looking for contributors for the open source projects, see project you can help on in the <a href="#organizations">Organizations section</a>. If you don&#39;t know how to help, we suggest reading <a href="#how-to-get-started">How to get started</a></p><h3 id="how-to-get-started" tabindex="-1">How to get started <a class="header-anchor" href="#how-to-get-started" aria-hidden="true">#</a></h3><p>Read the official <a href="https://hacktoberfest.com/participation/#beginner-resources" target="_blank" rel="noopener noreferrer">Hacktoberfest guide</a> to get started. After that, check out the organizations/projects bellow. You can <a href="https://discord.gg/XjV87YN" target="_blank" rel="noopener noreferrer">join the discord</a> to get in touch.</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Issues that are a particularly good fit for Hacktoberfest will be tagged as so.</p></div><h1 id="organizations" tabindex="-1">Organizations <a class="header-anchor" href="#organizations" aria-hidden="true">#</a></h1><p>Below is a list of organizations and their projects that are participating in Hacktoberfest.</p><h2 id="bedrock-oss" tabindex="-1">Bedrock-OSS <a class="header-anchor" href="#bedrock-oss" aria-hidden="true">#</a></h2><p>See all participating Bedrock-OSS projects <a href="https://github.com/orgs/Bedrock-OSS/repositories?q=topic%3Ahacktoberfest" target="_blank" rel="noopener noreferrer">here</a>.</p><h3 id="bedrock-wiki" tabindex="-1"><a href="https://github.com/Bedrock-OSS/bedrock-wiki" target="_blank" rel="noopener noreferrer">Bedrock Wiki</a> <a class="header-anchor" href="#bedrock-wiki" aria-hidden="true">#</a></h3><p>The Bedrock Wiki is a knowledge-sharing website for Technical Bedrock, containing documentation, tutorials, and general how-to information.</p><h3 id="regolith" tabindex="-1"><a href="https://github.com/Bedrock-OSS/regolith" target="_blank" rel="noopener noreferrer">Regolith</a> <a class="header-anchor" href="#regolith" aria-hidden="true">#</a></h3><p>Regolith is an Add-on Compiler for the Bedrock Edition of Minecraft.</p><h3 id="regolith-filters" tabindex="-1"><a href="https://github.com/Bedrock-OSS/regolith-filters" target="_blank" rel="noopener noreferrer">Regolith Filters</a> <a class="header-anchor" href="#regolith-filters" aria-hidden="true">#</a></h3><p>The standard library for Regolith filters.</p><h3 id="bedrock-loot-gen" tabindex="-1"><a href="https://github.com/Bedrock-OSS/bedrock-loot-gen" target="_blank" rel="noopener noreferrer">Bedrock Loot Gen</a> <a class="header-anchor" href="#bedrock-loot-gen" aria-hidden="true">#</a></h3><p>Website for creating Bedrock Edition loot tables.</p><h3 id="faqbot" tabindex="-1"><a href="https://github.com/Bedrock-OSS/bedrock-scripting-faq-bot" target="_blank" rel="noopener noreferrer">FaqBot</a> <a class="header-anchor" href="#faqbot" aria-hidden="true">#</a></h3><p>A bot for the Bedrock Add-Ons Discord server.</p><h2 id="blockception" tabindex="-1">Blockception <a class="header-anchor" href="#blockception" aria-hidden="true">#</a></h2><p>See all participating Blockception projects <a href="https://github.com/orgs/Blockception/repositories?q=topic%3Ahacktoberfest" target="_blank" rel="noopener noreferrer">here</a></p><h3 id="blockception-s-minecraft-bedrock-development" tabindex="-1"><a href="https://github.com/Blockception/VSCode-Bedrock-Development-Extension" target="_blank" rel="noopener noreferrer">Blockception&#39;s Minecraft Bedrock Development</a> <a class="header-anchor" href="#blockception-s-minecraft-bedrock-development" aria-hidden="true">#</a></h3><p>The repository that hosts the code for the VSCode extension that is used for Blockception&#39;s Minecraft Bedrock Development.</p><h3 id="minecraft-json-schemas" tabindex="-1"><a href="https://github.com/Blockception/Minecraft-bedrock-json-schemas" target="_blank" rel="noopener noreferrer">Minecraft Json Schemas</a> <a class="header-anchor" href="#minecraft-json-schemas" aria-hidden="true">#</a></h3><p>The JSON validation schema files for Minecraft bedrock</p>',26),n=[i];function c(s,h,l,d,p,f){return o(),t("div",null,n)}var g=e(a,[["render",c]]);export{b as __pageData,g as default};
